import React from 'react';
import { Jumbotron, Button } from 'reactstrap';


const Example = (props) => {
  return (
    <div>
      <Jumbotron>
        <h1 className="display-3">Hello</h1>
        <p className="lead">Welcome to GIVEAWAY</p>
      
      </Jumbotron>
    </div>
  );
};

export default Example;
